    martfury.searchLayeredNav = function () {
        var $widgets = $(".mf-widget-layered-nav");
        if ($widgets.length < 1) {
            return;
        }
        $widgets.find(".mf-widget-layered-nav-scroll").each(function () {
            var heightUL = $(this).data("height");
            if ($(this).height() > parseInt(heightUL)) {
                $(this).slimScroll({ height: heightUL, railVisible: !0, alwaysVisible: !0, size: "6px", color: "#666", railColor: "#ccc", railOpacity: 1 });
            }
        });
        $widgets.on("keyup", ".mf-input-search-nav", function (e) {
            var valid = !1;
            if (typeof e.which == "undefined") {
                valid = !0;
            } else if (typeof e.which == "number" && e.which > 0) {
                valid = !e.ctrlKey && !e.metaKey && !e.altKey;
            }
            if (!valid) {
                return;
            }
            var val = $(this).val();
            if (typeof val === "number") {
                val = "" + val;
            }
            var filter = val.toUpperCase(),
                widget = $(this).closest(".mf-widget-layered-nav"),
                ul = widget.find(".woocommerce-widget-layered-nav-list"),
                items = ul.children(".wc-layered-nav-term");
            items.each(function () {
                var a = $(this).find("a").data("title");
                if (typeof a === "number") {
                    a = "" + a;
                }
                a = a.toUpperCase();
                if (a.indexOf(filter) > -1) {
                    $(this).show();
                } else {
                    $(this).hide();
                }
            });
            var heightUL = ul.data("height");
            if (ul.height() < parseInt(heightUL)) {
                widget.addClass("no-scroll");
            } else {
                widget.removeClass("no-scroll");
            }
        });
    };
    martfury.instanceSearch = function () {
        if (martfuryData.ajax_search != "1") {
            return;
        }
        var xhr = null,
            searchCache = {},
            $form = martfury.$body.find("form.products-search");
        $form
            .on("keyup", ".search-field", function (e) {
                var valid = !1;
                if (typeof e.which == "undefined") {
                    valid = !0;
                } else if (typeof e.which == "number" && e.which > 0) {
                    valid = !e.ctrlKey && !e.metaKey && !e.altKey;
                }
                if (!valid) {
                    return;
                }
                if (xhr) {
                    xhr.abort();
                }
                var $currentForm = $(this).closest(".products-search"),
                    $search = $currentForm.find("input.search-field");
                if ($search.val().length < 2) {
                    $currentForm.removeClass("searching searched actived found-products found-no-product invalid-length");
                }
                search($currentForm);
            })
            .on("change", "#header-search-product-cat", function () {
                if (xhr) {
                    xhr.abort();
                }
                var $currentForm = $(this).closest(".products-search");
                search($currentForm);
            })
            .on("focusout", ".search-field", function () {
                var $currentForm = $(this).closest(".products-search"),
                    $search = $currentForm.find("input.search-field");
                if ($search.val().length < 2) {
                    $currentForm.removeClass("searching searched actived found-products found-no-product invalid-length");
                }
            });
        $(document).on("click", function (e) {
            if (!$form.hasClass("actived")) {
                return;
            }
            var target = e.target;
            if ($(target).closest(".products-search").length < 1) {
                $form.removeClass("searching searched actived found-products found-no-product invalid-length");
            }
        });
        function search($currentForm) {
            var $search = $currentForm.find("input.search-field"),
                keyword = $search.val(),
                cat = 0,
                $results = $currentForm.find(".search-results");
            if ($currentForm.find("#header-search-product-cat").length > 0) {
                cat = $currentForm.find("#header-search-product-cat").val();
            }
            if (keyword.trim().length < 2) {
                $currentForm.removeClass("searching found-products found-no-product").addClass("invalid-length");
                return;
            }
            $currentForm.removeClass("found-products found-no-product").addClass("searching");
            var keycat = keyword + cat;
            if (keycat in searchCache) {
                var result = searchCache[keycat];
                $currentForm.removeClass("searching");
                $currentForm.addClass("found-products");
                $results.html(result.products);
                $(document.body).trigger("martfury_ajax_search_request_success", [$results]);
                $currentForm.removeClass("invalid-length");
                $currentForm.addClass("searched actived");
            } else {
                var data = { term: keyword, nonce: martfuryData.nonce, cat: cat, search_type: martfuryData.search_content_type },
                    ajax_url = martfuryData.wc_ajax_url.toString().replace("%%endpoint%%", "martfury_search_products");
                xhr = $.post(ajax_url, data, function (response) {
                    var $products = response.data;
                    searchFormResult($currentForm, $results, $products, keycat);
                });
            }
        }
        function searchFormResult($currentForm, $results, $products, keycat) {
            $currentForm.removeClass("searching");
            $currentForm.addClass("found-products");
            $results.html($products);
            $currentForm.removeClass("invalid-length");
            $(document.body).trigger("martfury_ajax_search_request_success", [$results]);
            searchCache[keycat] = { found: !0, products: $products };
            $currentForm.addClass("searched actived");
        }
    };
